import React from 'react';
import BreadcrumbItem from 'antd/lib/breadcrumb/BreadcrumbItem';
import Breadcrumb from 'antd/lib/breadcrumb';

const Body = () => {
    return(
      <div style={{background:"#fff", padding:25, minHeight:530}}>
      <Breadcrumb>
        <BreadcrumbItem>
          {this.props.distribucion}
        </BreadcrumbItem>
      </Breadcrumb>
      </div>
    )
}

export default Body
